CREATE TABLE IF NOT EXISTS `tb_user` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `phone` varchar(20) NOT NULL COMMENT 'phone',
  `password` char(32) NOT NULL COMMENT 'password',
  `create_at` datetime NOT NULL COMMENT 'created time',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='user' AUTO_INCREMENT=1;

CREATE TABLE IF NOT EXISTS `tb_userinfo` (
  `user_id` int(11) unsigned NOT NULL COMMENT 'userID',
  `true_name` varchar(32) DEFAULT NULL COMMENT 'true name',
  `sex` tinyint(1) NOT NULL DEFAULT 1 COMMENT '1M 2F',
  `idcard` varchar(18) NULL COMMENT 'idcard',
  `qq` varchar(15) DEFAULT NULL COMMENT 'QQ',
  `wechat` varchar(15) DEFAULT NULL COMMENT 'wechat',
  `education` varchar(16) DEFAULT NULL COMMENT 'education',
  `marry` varchar(8) DEFAULT NULL COMMENT 'Married, unmarried, widowed',
  `work_unit` varchar(16) DEFAULT NULL COMMENT 'nature of work units',
  `work_tel` varchar(20) DEFAULT NULL COMMENT 'work tel ',
  `area_1` varchar(32) DEFAULT NULL COMMENT 'province',
  `area_2` varchar(32) DEFAULT NULL COMMENT 'city',
  `area_3` varchar(32) DEFAULT NULL COMMENT 'district',
  `home_tel` varchar(20) DEFAULT NULL COMMENT 'home tel',
  `credit_total_num` smallint(5) unsigned DEFAULT 0 COMMENT 'total credit card number',
  `credit_total_limit` decimal(15,2) DEFAULT '0.00' COMMENT 'total credit card limitation',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='userinfo';

CREATE TABLE IF NOT EXISTS `tb_areas` (
  `area_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `parent_id` int(10) unsigned NOT NULL COMMENT '上一级的id值',
  `area_name` varchar(50) NOT NULL COMMENT '地区名称',
  `sort` int(10) unsigned NOT NULL DEFAULT '99' COMMENT '排序',
  PRIMARY KEY (`area_id`),
  KEY `parent_id` (`parent_id`),
  KEY `sort` (`sort`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COMMENT='地区信息' AUTO_INCREMENT=659004403 ;

